import React, { Component } from "react";
import YouTubeComp from "../../YouTubeComp/YouTubeComp";

class Home extends Component {
  render() {
    return (
      <div>
        <YouTubeComp time="7.12" title="lofi playlist" desc="this is about lofi playlist"/>
        <YouTubeComp time="9.10" title="lofi music" desc="this is about lofi music"/>
        <YouTubeComp time="6.22" title="lofi chill" desc="this is about lofi chill"/>
        <YouTubeComp time="5.42" title="lofi jazz" desc="this is about lofi jazz"/>
        <YouTubeComp />
      </div>
    );
  }
}

export default Home;
